import React from "react";

const Results = (props) => {
  let results = props.shows.map((show, index) => {
    return (
      <div key={index} className="Results_item">
        <img className="Results_item_image" src={show.image} alt={show.name} />
        <p className="Results_item_title">{show.name}</p>
      </div>
    );
  });

  return (
    <div>
      <button onClick={props.onSearchAgain} className="btn btn-danger">
        Back to Search
      </button>
      <br />
      <br />
      <div className="Results">{results}</div>
    </div>
  );
};

export default Results;
